import React, {useState} from 'react'

export default function Loginform({Login,error}) {
    const[details, setDetails] = useState({email:"" ,password:""});
    const sumbitHandler = e => {
        e.preventDefault();
        Login(details);
    }
  return (
    <form onSubmit={sumbitHandler}> 
        <div className='form-inner'>
            <h2>Registration form</h2>
            <div className='form-group'>
                <label htmlFor='Name'>Name:</label>
                <input type="name" name='name' id="name" onChange={e => setDetails({...details, name: e.target.value})} value={details.name}/>

            </div>
            <div className='form-group'>
                <label htmlFor='Phone Number'>Phone Number::</label>
                <input type="phonenumber" name='phonenumber' id="phonenumber" onChange={e => setDetails({...details, password: e.target.value})} value={details.password}/>
                </div>
                <input type="submit" value="Register"></input>


        </div>
    </form>
  )
}
